def get_month(text: str):
    """Return month number (1..12) or None. Normalizes input and looks up in MONTHS."""
    if not text: return None
    t = re.sub(r'[^a-z0-9а-яё\s]', '', text.lower()).strip()
    t = re.sub(r'\s+', ' ', t)
    return MONTHS.get(t)
